import React, {Component} from 'react';
//引入组件
import { Carousel } from 'antd';
import {Link} from "react-router-dom";
//引入样式
import './home.scss';

//引入样式
import 'antd/dist/antd.css'//蚂蚁设计中样式
class Home extends Component {
    render() {
        return (
            <div>
                {/*头部*/}
                <div className="header">
                    {/*定位区块*/}
                    <div className="location">
                        {/*<span></span>*/}
                        <span className="location-icon iconfont icon-dingwei"></span>
                        <span className="location-text">成都市双流区</span>
                        <span className="location-choose iconfont icon-plus-select-down"></span>
                    </div>
                    {/*搜索*/}
                    <div className="search">
                        <Link to="/search" className="search-input">
                            <span className="search-icon iconfont icon-sousuo"></span>
                            <span className="search-text"> 搜索饿了么商家、商品名称</span>

                        </Link>

                    </div>

                </div>
                {/*商品列表去*/}
                <div className="shop-banner">
                    {/*引入轮播图组件*/}
                    <Carousel autoplay>
                        <ul className="shop-list">
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/5.webp")} alt="美食"/>
                                    <p >美食</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/4.webp")} alt="商超便利"/>
                                    <p >商超便利</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/3.webp")} alt="午餐"/>
                                    <p >午餐</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/10.webp")} alt="水果"/>
                                    <p >水果</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/6.webp")} alt="医疗健康"/>
                                    <p >医疗健康</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/9.webp")} alt="浪漫鲜花"/>
                                    <p >浪漫鲜花</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/7.webp")} alt="厨房生鲜"/>
                                    <p >厨房生鲜</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/8.webp")} alt="跑腿代购"/>
                                    <p >跑腿代购</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/9.webp")} alt="地方小吃"/>
                                    <p >地方小吃</p>
                                </Link>
                            </li>
                            <li>
                                <Link to='/'>
                                    <img src={require("../../static/img/shopbanberimg/8.webp")} alt="签到领红包"/>
                                    <p >签到领红包</p>
                                </Link>
                            </li>

                        </ul>
                        {/*<div>*/}
                            {/*<ul className="shop-list">*/}
                                {/*<li>*/}
                                    {/*<Link to='/'>*/}
                                        {/*<img src={require("../../static/img/shopbanberimg/11.webp")} alt="地方菜系"/>*/}
                                        {/*<p >地方菜系</p>*/}
                                    {/*</Link>*/}
                                {/*</li>*/}
                                {/*<li>*/}
                                    {/*<Link to='/'>*/}
                                        {/*<img src={require("../../static/img/shopbanberimg/12.webp")} alt="地方菜系"/>*/}
                                        {/*<p >麻辣烫</p>*/}
                                    {/*</Link>*/}
                                {/*</li>*/}
                            {/*</ul>*/}
                        {/*</div>*/}

                    </Carousel>

                </div>
            </div>
        );
    }
}

export default Home;
